import React, { useState } from 'react';
import axios from 'axios';

const CoinOptimizer = () => {
  const [targetAmount, setTargetAmount] = useState(0);
  const [coinDenominations, setCoinDenominations] = useState([]);
  const [changeResult, setChangeResult] = useState([]);

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:8080/api/coins/optimize', {
        targetAmount: targetAmount,
        coinDenominations: coinDenominations
      });

      setChangeResult(response.data);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div>
      <h2>Coin Optimizer</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Target Amount:
          <input type="number" value={targetAmount} onChange={(e) => setTargetAmount(e.target.value)} />
        </label>
        <br />
        <label>
          Coin Denominations (comma-separated):
          <input type="text" value={coinDenominations.join(',')} onChange={(e) => setCoinDenominations(e.target.value.split(','))} />
        </label>
        <br />
        <button type="submit">Optimize Coins</button>
      </form>
      <div>
        {changeResult.length > 0 ? (
          <div>
            <h3>Minimum Coins:</h3>
            <ul>
              {changeResult.map((coin, index) => (
                <li key={index}>{coin}</li>
              ))}
            </ul>
          </div>
        ) : (
          <p>No exact change found or error occurred.</p>
        )}
      </div>
    </div>
  );
};

export default CoinOptimizer;
